import { Text } from 'react-native';

const Header = () => {
  return (
    <View style={styles.header}>
      <Text>Academy header</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  header: {
    backgroundColor: 'orange',
    fontSize: 20
  },
});

export default Header;
